namespace Shine
{
	/** 全局配置表(generated by shine) */
	export class GlobalReadData extends BaseData
	{
		/** 每个账号一个区服可拥有的角色数目(合服不影响每个被合区服的拥有角色数目) */
		public ownPlayerNum:number;
		
		/** 角色名字上限数目(机器字) */
		public playerNameLength:number;
		
		/** 角色名字是否使用区服ID作为前缀,如(s1.张三) */
		public isNameUseAreaIDAsFront:boolean;
		
		/** 角色名字是否可以重名 */
		public canPlayerNameRepeat:boolean;
		
		/** 客户端离线事务，每日可修改时间的次数 */
		public clientOfflineWorkTimeChangeDailyNum:number;
		
		/** 显示网络延迟圈圈最大超时时间(ms) */
		public showNetDelayMaxTime:number;
		
		/** 显示网络延迟圈圈最小间隔(ms) */
		public showNetDelayMinTime:number;
		
		/** 激活码长度 */
		public activationCodeLength:number;
		
		/** 激活码是否使用批次(每批次每个玩家只能用一次) */
		public activationCodeUseBatch:boolean;
		
		/** 游戏信息日志保留时间(玩家自身)(day) */
		public infoLogKeepTime:number;
		
		/** 游戏信息日志保留数目(玩家自身) */
		public infoLogKeepNum:number;
		
		/** 翻页显示插件每页CD(s) */
		public pageToolShowCD:number;
		
		/** 大Float数字每段位数(3为千,4为万) */
		public bigFloatWei:number;
		
		/** 坐标推送缩放比率 */
		public posSendScale:number;
		
		/** 朝向推送缩放比率 */
		public directionSendScale:number;
		
		/** 保持当前属性百分比在上限改变前(否则就是保持当前值不变) */
		public keepCurrentPercentAtMaxChange:boolean;
		
		/** 单位转身XY和最小值(小于此值不转身) */
		public unitTurnXYSumMin:number;
		
		/** 单位移动XY和的最大允许误差(超过此值即拉回) */
		public unitMovePosMaxDeviation:number;
		
		/** 距离验证允许误差 */
		public distanceCheckDeviation:number;
		
		/** 移动速度最小值 */
		public moveSpeedMin:number;
		
		/** 移动速度最大值 */
		public moveSpeedMax:number;
		
		/** 攻击速度最小值 */
		public attackSpeedMin:number;
		
		/** 攻击速度最大值 */
		public attackSpeedMax:number;
		
		/** 施法速度最小值 */
		public castSpeedMin:number;
		
		/** 施法速度最大值 */
		public castSpeedMax:number;
		
		/** 使用移动速度比率(使用值=数值*比率)(每秒多少米) */
		public useMoveSpeedRatio:number;
		
		/** 命中公式参数0(基础命中率) */
		public hitRateArg0:number;
		
		/** 暴击公式参数0(基础暴击率) */
		public critArg0:number;
		
		/** 暴击默认伤害比率 */
		public critDamageBaseRatio:number;
		
		/** 子弹最长保留时间(s) */
		public bulletMaxLastTime:number;
		
		/** 场景保留时间(s) */
		public sceneKeepTime:number;
		
		/** 攻击范围背向延伸距离(米) */
		public attackScopeBackLength:number;
		
		/** 攻击范围默认攻击高度(米) */
		public attackScopeDefaultHeight:number;
		
		/** 默认显示帧率 */
		public defaultShowFps:number;
		
		/** 帧同步缓存帧数 */
		public frameSyncCacheFrames:number;
		
		/** 徘徊等待时间最小值(s) */
		public wanderWaitTimeMin:number;
		
		/** 徘徊等待时间最大值(s) */
		public wanderWaitTimeMax:number;
		
		/** 徘徊移动半径(米) */
		public wanderMoveRadius:number;
		
		/** 阻止网络延迟时间(ms) */
		public preventNetDelayTime:number;
		
		/** 场景分线数目(仅在sceneLinePlayerLimitNum为0时有意义) */
		public sceneLineNum:number;
		
		/** 朝向移动预测最短距离(米) */
		public moveDirForecastMinDistance:number;
		
		/** 朝向移动预测时间(ms) */
		public moveDirForecastTime:number;
		
		/** 朝向移动预测发送消息间隔(ms) */
		public moveDirSendDelay:number;
		
		/** 客户端移动消息发送最短间隔(ms) */
		public clientMoveSendMinDelay:number;
		
		/** 出生主城ID */
		public bornTownID:number;
		
		/** 怪物退回时每秒回血千分比 */
		public monsterBackAddHPPercent:number;
		
		/** 出生主城位置ID */
		public bornTownPosID:number;
		
		/** 场景分线角色限制数目(当此值大于0时,视为启用按人数分线策略,并且sceenLineNum值无效) */
		public sceneLinePlayerLimitNum:number;
		
		/** 匹配成功后最长等待确认时间(s) */
		public matchWaitTime:number;
		
		/** aoi可视单位上限 */
		public aoiSeeMax:number;
		
		/** 场景AOI灯塔尺寸 */
		public aoiTowerSize:number;
		
		/** 拾取范围半径(米) */
		public pickUpRadius:number;
		
		/** 自增属性计算间隔(ms) */
		public increaseAttributeDelay:number;
		
		/** 摄像机最近距离(与目标距离) */
		public cameraMinDistance:number;
		
		/** 摄像机最长距离(与目标距离) */
		public cameraMaxDistance:number;
		
		/** 摄像机2.5D视角(角度) */
		public camera25DAngle:number;
		
		/** 摄像机最小视角(角度) */
		public cameraMinAxisXAngle:number;
		
		/** 摄像机大小视角(角度) */
		public cameraMaxAxisXAngle:number;
		
		/** 摄像机缓动时间(s) */
		public cameraTweenTime:number;
		
		/** 摄像机鼠标滚轮缩放速度 */
		public cameraWheelSpeed:number;
		
		/** 摄像机默认距离 */
		public cameraDefaultDistance:number;
		
		/** 摄像机X轴旋转速度 */
		public cameraRotateSpeedX:number;
		
		/** 摄像机Y轴旋转速度 */
		public cameraRotateSpeedY:number;
		
		/** 摄像机触摸缩放速度 */
		public cameraScaleSpeed:number;
		
		/** 等级上限 */
		public levelMax:number;
		
		/** 主背包格子数(初始) */
		public mainBagGridNum:number;
		
		/** 邮件每页显示数目 */
		public mailPageEachShowNum:number;
		
		/** 邮件最多保存数目 */
		public mailSaveMaxNum:number;
		
		/** 邮件最长保存时间(天) */
		public mailSaveMaxTime:number;
		
		/** 玩家发送的邮件ID */
		public playerMailID:number;
		
		/** 任务可视等级差 */
		public questCanSeeLevelD:number;
		
		/** 好友功能启用双向好友(否则单向) */
		public useOvonicFriend:boolean;
		
		/** 好友上限数目(0为无上限) */
		public friendMaxNum:number;
		
		/** 好友黑名单上限数目(0为无上限) */
		public friendBlackListMaxNum:number;
		
		/** 申请添加好友上限数目(0为无上限) */
		public applyAddFriendMaxNum:number;
		
		/** 好友申请最长保存时间(天) */
		public friendApplySaveMaxTime:number;
		
		/** 地图阻挡尺寸(米) */
		public mapBlockSize:number;
		
		/** 工会的玩家群id(<=0则为无工会) */
		public unionRoleGroupID:number;
		
		/** 组队的玩家群id(<=0则为无组队功能) */
		public teamRoleGroupID:number;
		
		/** 组队共享半径(米)(0为无限) */
		public teamShareRadius:number;
		
		/** 读取字节流(简版) */
		protected toReadBytesSimple(stream:BytesReadStream):void
		{
			this.ownPlayerNum=stream.readInt();
			
			this.playerNameLength=stream.readInt();
			
			this.isNameUseAreaIDAsFront=stream.readBoolean();
			
			this.canPlayerNameRepeat=stream.readBoolean();
			
			this.clientOfflineWorkTimeChangeDailyNum=stream.readInt();
			
			this.showNetDelayMinTime=stream.readInt();
			
			this.showNetDelayMaxTime=stream.readInt();
			
			this.activationCodeLength=stream.readInt();
			
			this.activationCodeUseBatch=stream.readBoolean();
			
			this.infoLogKeepTime=stream.readInt();
			
			this.infoLogKeepNum=stream.readInt();
			
			this.pageToolShowCD=stream.readInt();
			
			this.bigFloatWei=stream.readInt();
			
			this.posSendScale=stream.readFloat();
			
			this.directionSendScale=stream.readFloat();
			
			this.keepCurrentPercentAtMaxChange=stream.readBoolean();
			
			this.unitTurnXYSumMin=stream.readFloat();
			
			this.unitMovePosMaxDeviation=stream.readFloat();
			
			this.distanceCheckDeviation=stream.readFloat();
			
			this.moveSpeedMin=stream.readInt();
			
			this.moveSpeedMax=stream.readInt();
			
			this.attackSpeedMin=stream.readInt();
			
			this.attackSpeedMax=stream.readInt();
			
			this.castSpeedMin=stream.readInt();
			
			this.castSpeedMax=stream.readInt();
			
			this.useMoveSpeedRatio=stream.readFloat();
			
			this.hitRateArg0=stream.readFloat();
			
			this.critArg0=stream.readFloat();
			
			this.critDamageBaseRatio=stream.readFloat();
			
			this.bulletMaxLastTime=stream.readInt();
			
			this.sceneKeepTime=stream.readInt();
			
			this.attackScopeBackLength=stream.readFloat();
			
			this.attackScopeDefaultHeight=stream.readFloat();
			
			this.defaultShowFps=stream.readFloat();
			
			this.frameSyncCacheFrames=stream.readInt();
			
			this.wanderWaitTimeMin=stream.readInt();
			
			this.wanderWaitTimeMax=stream.readInt();
			
			this.wanderMoveRadius=stream.readFloat();
			
			this.preventNetDelayTime=stream.readInt();
			
			this.increaseAttributeDelay=stream.readInt();
			
			this.clientMoveSendMinDelay=stream.readInt();
			
			this.moveDirSendDelay=stream.readInt();
			
			this.moveDirForecastTime=stream.readInt();
			
			this.moveDirForecastMinDistance=stream.readFloat();
			
			this.mapBlockSize=stream.readFloat();
			
			this.monsterBackAddHPPercent=stream.readInt();
			
			this.sceneLineNum=stream.readInt();
			
			this.sceneLinePlayerLimitNum=stream.readInt();
			
			this.bornTownID=stream.readInt();
			
			this.bornTownPosID=stream.readInt();
			
			this.matchWaitTime=stream.readInt();
			
			this.aoiTowerSize=stream.readInt();
			
			this.aoiSeeMax=stream.readInt();
			
			this.pickUpRadius=stream.readFloat();
			
			this.cameraMinDistance=stream.readFloat();
			
			this.cameraMaxDistance=stream.readFloat();
			
			this.camera25DAngle=stream.readFloat();
			
			this.cameraMinAxisXAngle=stream.readFloat();
			
			this.cameraMaxAxisXAngle=stream.readFloat();
			
			this.cameraTweenTime=stream.readFloat();
			
			this.cameraWheelSpeed=stream.readFloat();
			
			this.cameraDefaultDistance=stream.readFloat();
			
			this.cameraRotateSpeedX=stream.readFloat();
			
			this.cameraRotateSpeedY=stream.readFloat();
			
			this.cameraScaleSpeed=stream.readFloat();
			
			this.levelMax=stream.readInt();
			
			this.mainBagGridNum=stream.readInt();
			
			this.mailPageEachShowNum=stream.readInt();
			
			this.mailSaveMaxNum=stream.readInt();
			
			this.mailSaveMaxTime=stream.readInt();
			
			this.playerMailID=stream.readInt();
			
			this.questCanSeeLevelD=stream.readInt();
			
			this.useOvonicFriend=stream.readBoolean();
			
			this.friendMaxNum=stream.readInt();
			
			this.friendBlackListMaxNum=stream.readInt();
			
			this.applyAddFriendMaxNum=stream.readInt();
			
			this.friendApplySaveMaxTime=stream.readInt();
			
			this.unionRoleGroupID=stream.readInt();
			
			this.teamRoleGroupID=stream.readInt();
			
			this.teamShareRadius=stream.readFloat();
			
		}
		
	}
}
